	@Test
	public void highlyDuplicatesTilesAgain3() {
		TIntObjectMap<int[]> cache = new TIntObjectHashMap<>();
		setup5(cache);
		/*
		 * orig seq
		 * GCATCATCTCAGTGGAAATTTTACATTAGGT
		 * 
		 */
		String revComp = SequenceUtil.reverseComplement("GCATCATCTCAGTGGAAATTTTACATTAGGT");
		System.out.println("revComp: " + revComp);
		Map<Integer,TLongList> map = TiledAlignerUtil.getCountStartPositionsMapUsingCache(cache,revComp,13,true,true);
		for (Entry<Integer, TLongList> entry : map.entrySet()) {
			System.out.println("entry: " + Arrays.toString(NumberUtils.splitIntInto2(entry.getKey())) + ", " + (entry.getValue().size() != 1 ? entry.getValue().size() + "" :  NumberUtils.getLongPositionValueFromPackedLong( entry.getValue().get(0)) + ":" +  NumberUtils.getShortFromLong(entry.getValue().get(0), 40)));
			if (entry.getValue().size() < 10 && entry.getValue().size() > 1) {
				for (long l :  entry.getValue().toArray()) {
					System.out.println(NumberUtils.getLongPositionValueFromPackedLong(l) + ":" +  NumberUtils.getShortFromLong(l, 40));
				}
			}
		}
		System.out.println("Number of entries in map: " + map.size());
		
		assertEquals(4, map.size());
		
		/*
		 * top match is 19,0
		 */
		assertEquals(2696728968l, NumberUtils.getLongPositionValueFromPackedLong(map.get(NumberUtils.pack2IntsInto1(19, 0)).get(0)));
	}
	
